c(31,"Technologies"),a.tc(),a.uc(32,"li"),a.Nc(33,"Demo"),a.tc(),a.uc(34,"li"),a.Nc(35,"Micro Apps as Web Components with Angular Elements"),a.tc(),a.uc(36,"li"),a.Nc(37,"Dynamically Loading Micro Apps"),a.tc(),a.uc(38,"li"),a.Nc(39,"Communication between Micro Apps"),a.tc(),a.uc(40,"li"),a.Nc(41,"Evaluation"),a.tc(),a.tc(),a.sc(42,"hr"),a.uc(43,"h2"),a.Nc(44,"Case Study"),a.tc(),a.uc(45,"p"),a.Nc(46,"Regardless of programming language, experts from development teams builds various different micro frontend web components . Once they commit/push any change in Git, the CI/CD pipeline re-deploy docker pods in container-orchestration. On the other hand our's shell web app dynamically download those components from kubernetes and render it during runtime. Moreover, the shell and Kafka-Rest api takes care about routing between the components and allows them to inter-communicate with each other using message passing stream (Kafka) and websockets. "),a.tc(),a.uc(47,"div"),a.sc(48,"img",5),a.tc(),a.sc(49,"hr"),a.uc(50,"h2"),a.Nc(51,"Prerequisite"),a.tc(),a.uc(52,"h5"),a.Nc(53,"Node"),a.tc(),a.uc(54,"p"),a.Nc(55,"Download the "),a.uc(56,"a",6),a.Nc(57,"Node.js"),a.tc(),a.Nc(58," source code or a pre-built installer for your platform "),a.tc(),a.sc(59,"hr"),a.uc(60,"h2"),a.Nc(61,"Technologies"),a.tc(),a.uc(62,"h5"),a.Nc(63,"Node"),a.tc(),a.uc(64,"p"),a.uc(65,"b"),a.Nc(66,"Node.js"),a.tc(),a.Nc(67," is an open-source, cross-platform, back-end JavaScript runtime environment that runs on the V8 engine and executes. "),a.tc(),a.uc(68,"h5"),a.Nc(69,"Kubernetes"),a.tc(),a.uc(70,"p"),a.uc(71,"b"),a.Nc(72,"Kubernetes"),a.tc(),a.Nc(73," is an open-source container-orchestration system for automating computer application deployment, scaling, and management. "),a.tc(),a.uc(74,"h5"),a.Nc(75,"Angular"),a.tc(),a.uc(76,"p"),a.uc(77,"b"),a.Nc(78,"Angular"),a.tc(),a.Nc(79," is a TypeScript-based open-source web application framework led by the Angular Team at Google and by a community of individuals and corporations. It is a complete rewrite from the same team that built AngularJS. "),a.tc(),a.uc(80,"h5"),a.Nc(81,"WebSockets"),a.tc(),a.uc(82,"p"),a.uc(83,"b"),a.Nc(84,"WebSocket"),a.tc(),a.Nc(85," is a computer communications protocol, providing full-duplex communication channels over a single TCP connection "),a.tc(),a.sc(86,"hr"),a.uc(87,"h2"),a.Nc(88,"Game Demo"),a.tc(),a.uc(89,"p"),a.Nc(90,"Let me present a working online demo of this SPA. This game demo hints at the many benefits of using micro frontends - multiple teams working in parallel and independently supporting complex SPAs. The code for the game apps is in separate repository. Check out the full working game demo component below!"),a.tc(),a.uc(91,"div",7),a.uc(92,"div",8),a.sc(93,"game-app"),a.tc(),a.tc(),a.sc(94,"br"),a.uc(95,"p"),a.Nc(96," If you are curious to know, that I am using Shadow DOM feature of web components so that i can prevent the leakage of styles and keeping it completely isolated. "),a.tc(),a.sc(97,"hr"),a.uc(98,"h2"),a.Nc(99,"Micro Apps as Web Components with Angular Elements"),a.tc(),a.uc(100,"p"),a.Nc(101," Let's install "),a.uc(102,"b"),a.Nc(103,"@angular/elements"),a.tc(),a.Nc(104," you just need to declare your Angular Component with a module and add it into the entryComponents array. EntryComponent helps to create Angular Elements dynamically at runtime. Than we will wrap the component using createCustomElement and register it as a custom element with the browser using its customElements.define method: "),a.tc(),a.uc(105,"span",9),a.uc(106,"span",10),a.Nc(107," npm i @angular/elements @webcomponents/custom-elements -D "),a.tc(),a.tc(),a.uc(108,"h5"),a.Nc(109," Edit app.module.ts"),a.tc(),a.uc(110,"p"),a.Nc(111," Edit this file to define the custom element using createCustomElement, which will contain our AppComponent: "),a.tc(),a.uc(112,"span",9),a.uc(113,"pre",10),a.Nc(114),a.tc(),a.tc(),a.uc(115,"p"),a.Nc(116," The AppModule above does not bootstrap a traditional Angular component. Hence, the bootstrap array is empty and we need to introduce an ngDoBootstrap method intended for manual bootstrapping. We also need to register the CUSTOM_ELEMENTS_SCHEMA to inform Angular compiler that there will be component it might not aware of so that they can directly executed by the browser. "),a.tc(),a.uc(117,"p"),a.Nc(118," We also need a polyfill for browsers that don't support Web Components. Hence, I've npm installed @webcomponents/custom-elements and referenced it at the end of the polyfills.ts file: "),a.tc(),a.uc(119,"span",9),a.uc(120,"span",10),a.Nc(121," import '@webcomponents/custom-elements/custom-elements.min'; import '@webcomponents/webcomponentsjs/custom-elements-es5-adapter.js'; "),a.tc(),a.tc(),a.uc(122,"p"),a.Nc(123," You may also want to remove "),a.uc(124,"b"),a.Nc(125,"zone.js"),a.tc(),a.Nc(126," if your custom element is going to live inside another angular application. However, you can only have one version of this file on a page, so if you are including this angular element in a parent angular application, you probably don\u2019t want it in your custom element build. For absolute clarity we are going to remove zone.js (as we will be using this in another angular app) and leave in the web component polyfill as it will be the only custom element on the pag. but you do what you need to do! "),a.tc(),a.uc(127,"h5"),a.Nc(128," Configure build"),a.tc(),a.uc(129,"p"),a.Nc(130," If you run ng build, your application should build successfully but to export our application as a custom element, we ideally want to have a single JS file e.g. custom-element.js. There is a way to combine multiple dist files natively within angular, so I\u2019ve had to add a couple of extra scripts in package.json. "),a.tc(),a.uc(131,"span",9),a.uc(132,"pre",10),a.Nc(133),a.tc(),a.tc(),a.uc(134,"p"),a.Nc(135," Now if you run npm run el-build, you should see a custom-element.js file in the dist folder, once it has compiled. "),a.tc(),a.uc(136,"h5"),a.Nc(137," That's it"),a.tc(),a.uc(138,"p"),a.Nc(139," To use your new custom element, serve a static index.html and reference the new custom-element.js in a script tag and include your custom tag as an HTML element in the body of the page. "),a.tc(),a.sc(140,"hr"),a.uc(141,"h2"),a.Nc(142,"Dynamically Loading Micro Apps"),a.tc(),a.uc(143,"p"),a.Nc(144," As web components work as traditional html elements, we can dynamically load them into our app using DOM. For this task, I've created a simple configuration object pointing to all the data we need: "),a.tc(),a.uc(145,"span",9),a.uc(146,"pre",10),a.Nc(147),a.tc(),a.tc(),a.uc(148,"p"),a.Nc(149," To load one of those clients, we just need to create a script tag pointing to its bundle and an element representing the micro app: "),a.tc(),a.uc(150,"span",9),a.uc(151,"pre",10),a.Nc(152),a.tc(),a.tc(),a.uc(153,"p"),a.Nc(154," Now we can even decide when to call the loadScript function for our application. This means, we can implements eager loading or lazy loading as follow: "),a.tc(),a.uc(155,"span",9),a.uc(156,"pre",10),a.Nc(157),a.tc(),a.tc(),a.uc(158,"p"),a.Nc(159," We will come back to this later and add some more code in order to integrate with back-end server, but first let's build one server api in our next section which is accountable for inter-web component communication. "),a.tc(),a.sc(160,"hr"),a.uc(161,"h2"),a.Nc(162,"Communication between Micro Apps"),a.tc(),a.uc(163,"p"),a.Nc(164,"Due to the isolated characterictics of our micro web-components, they cannot see each other when they are dynamically render on the single page shell. Moreover parent shell also doesn't take the reponsibility to set up mesh like networks between several micro-fontend components. To make things simple, concise and easy to manage, each individual component will set up their own channel in Apache Kafka. In this section we will see how to build Real Time Data exchange between Angular clients over Kafka with STOMP Websocket using Spring Boot. We need to provide or set up some basic things that make real time stream possible such as, Kafka data pipeline, the kafka cluster information, application id, the topic to consume, Serdes to use, and so on. We learn't how to set up kafka in our previous article uing docker engine. Let\u2019s create a project in maven and update pom.xml file: "),a.tc(),a.uc(165,"span",9),a.uc(166,"pre",10),a.Nc(167,"<"),a.uc(168,"span"),a.uc(169,"span"),a.Nc(170,'project xmlns="http://maven.apache.org/POM/4.0.0"\n  xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance"\n  xsi:schemaLocation="http://maven.apache.org/POM/4.0.0 http://maven.apache.org/xsd/maven-4.0.0.xsd"'),a.tc(),a.tc(),a.Nc(171,">\n    <"),a.uc(172,"span"),a.uc(173,"span"),a.Nc(174,"modelVersion"),a.tc(),a.tc(),a.Nc(175,">4.0.0 </"),a.uc(176,"span"),a.uc(177,"span"),a.Nc(178,"modelVersion"),a.tc(),a.tc(),a.Nc(179,">\n\n    <"),a.uc(180,"span"),a.uc(181,"span"),a.Nc(182,"groupId"),a.tc(),a.tc(),a.Nc(183,">com.roytuts </"),a.uc(184,"span"),a.uc(185,"span"),a.Nc(186,"groupId"),a.tc(),a.tc(),a.Nc(187,">\n    <"),a.uc(188,"span"),a.uc(189,"span"),a.Nc(190,"artifactId"),a.tc(),a.tc(),a.Nc(191,">spring-apache-kafka-streams-websocket-stomp-server </"),a.uc(192,"span"),a.uc(193,"span"),a.Nc(194,"artifactId"),a.tc(),a.tc(),a.Nc(195,">\n    <"),a.uc(196,"span"),a.uc(197,"span"),a.Nc(198,"version"),a.tc(),a.tc(),a.Nc(199,">0.0.1-SNAPSHOT </"),a.uc(200,"span"),a.uc(201,"span"),a.Nc(202,"version"),a.tc(),a.tc(),a.Nc(203,">\n\n    <"),a.uc(204,"span"),a.uc(205,"span"),a.Nc(206,"parent"),a.tc(),a.tc(),a.Nc(207,">\n      <"),a.uc(208,"span"),a.uc(209,"span"),a.Nc(210,"groupId"),a.tc(),a.tc(),a.Nc(211,">org.springframework.boot </"),a.uc(212,"span"),a.uc(213,"span"),a.Nc(214,"groupId"),a.tc(),a.tc(),a.Nc(215,">\n      <"),a.uc(216,"span"),a.uc(217,"span"),a.Nc(218,"artifactId"),a.tc(),a.tc(),a.Nc(219,">spring-boot-starter-parent </"),a.uc(220,"span"),a.uc(221,"span"),a.Nc(222,"artifactId"),a.tc(),a.tc(),a.Nc(223,">\n      <"),a.u